message:
Russia stages a patriotic concert to rally support for the war in Ukraine.

It was probably the most public celebration of war and violence that Russia has mounted since its full-scale invasion of Ukraine a year ago. Tens of thousands of people gathered at Russia’s largest stadium for an event called “Glory to the Defenders of the Fatherland.” Read more

@nytimes

Explosions boom in Kharkiv as Ukraine braces for a large Russian barrage for the war’s anniversary.

Several explosions rang out on Wednesday in the eastern Ukrainian city of Kharkiv amid a nationwide air alert and warnings from Ukrainian officials that Russia was planning a large-scale missile barrage timed to Friday’s anniversary of its invasion. Read more

@nytimes

The U.N. says the civilian death toll in Ukraine is more than 8,000, and probably significantly higher.

As the first anniversary of Russia’s invasion of Ukraine approaches, United Nations monitors in Ukraine said they had verified the deaths of 8,006 civilians, including 487 children, but cautioned that the actual number of civilians killed in the war is thousands higher. Read more

@nytimes

Wagner Group Chief Accuses Russian Military Command of Treason

The head of Russia’s Wagner mercenary group accused the country’s defense minister and its highest-ranking general of treason on Tuesday, intensifying the most high-profile dispute in the Russian forces since the full-scale invasion of Ukraine began. Read more

@nytimes

Biden Visits Kyiv, Ukraine’s Besieged Capital

President Biden made a secret trip to Kyiv, Ukraine, in a demonstration of his administration’s resolve in the face of Russia’s yearlong invasion. Read more

@nytimes

One Year Into War, Putin Is Crafting the Russia He Craves

As Friday’s first anniversary of the invasion approaches, Russia’s military has suffered setback after setback, falling far short of its goal of taking control of Ukraine. But at home, facing little resistance, Mr. Putin’s year of war has allowed him to go further than many thought possible in reshaping Russia in his image. Read more

@nytimes

Russian missiles damage buildings and injure two people in western Ukraine.

Russian forces fired four cruise missiles from the Black Sea at Ukraine on Saturday, with two of them striking buildings and injuring two people in a city in the western part of the country as Ukrainian officials warned of a major attack by Russia before the upcoming first anniversary of its full-scale invasion. Read more

@nytimes

Kamala Harris says Moscow committed crimes against humanity in Ukraine.

Vice President Kamala Harris stressed on Saturday that Russia must be held to account for its “barbaric” actions in Ukraine, telling a security conference in Munich that the United States had formally determined that Moscow’s forces had committed crimes against humanity. Read more

@nytimes

The head of Russia’s Wagner group acknowledges the slow pace of the battle for Bakhmut.

The head of the Wagner private military company says he expects that it will be months before the long-contested Ukrainian city of Bakhmut is captured, making it highly unlikely that Russian commanders will be able to hand a big victory to President Vladimir Putin before next week’s anniversary of Russia’s invasion of Ukraine. Read more

@nytimes

The president of Belarus meets Putin amid speculation about the country’s role in the war.

President Aleksandr Lukashenko of Belarus met with President Vladimir Putin of Russia in Moscow on Friday amid speculation that Belarus will be pressed into providing more support for Moscow’s war in Ukraine. Read more

@nytimes

Ukraine and Russia swap 202 prisoners, including soldiers who defended Mariupol.

Ukraine and Russia exchanged prisoners of war on Thursday, officials from both countries said, including 63 Ukrainian soldiers who had made the last stand at the Azovstal steel plant in the southern city of Mariupol. Read more

@nytimes

‘The World’s Largest Construction Site’: The Race Is On to Rebuild Ukraine

Businesses around the world are positioning themselves for what could be a multibillion-dollar effort to rebuild Ukraine once Russia's war is over. Some estimates put the cost of rebuilding the country's infrastructure as high as $750 billion. Read more

@nytimes

Putin says more Russians are applying to adopt Ukrainian children.

After a report this week renewed scrutiny on Moscow for deporting Ukrainian children and detaining others, President Vladimir V. Putin of Russia, ignoring widespread condemnations of human rights abuses, said more Russian families want to adopt Ukrainian children. Read more

@nytimes

Russia strikes infrastructure and kills one person in predawn attacks.

Russia unleashed an aerial assault on cities across Ukraine before dawn on Thursday, killing one person, hours after Ukraine said Russia had floated balloons over Kyiv that were probably intended to distract and disrupt Ukrainian air defenses. Read more

@nytimes

Russia lost about half of its tanks since invading Ukraine, a new report says.

The Russian military has lost at least half of its tanks since it invaded Ukraine, according to a report by a London-based think tank released on Wednesday, a potential constraint as fighting intensifies again and Moscow struggles to expand its offensive operations. Read more

@nytimes

Russian balloons floating over Kyiv were shot down, city officials say.

At least six Russian balloons floated over the Ukrainian capital of Kyiv on Wednesday, triggering air raid sirens before most of them were shot down, Ukrainian officials said, prompting speculation about their purpose and when they were first deployed. Read more

@nytimes

Heavy Losses Renew Questions About Russia Sustaining Its Offensive

As Russia steps up its offensive in eastern Ukraine, weeks of failed attacks on a Ukrainian stronghold have left two Russian brigades in tatters, raised questions about Moscow’s military tactics and renewed doubts about its ability to maintain sustained, large-scale ground assaults. Read more

@nytimes

In Bleak Russian Cemetery, Sea of Crosses Signals War’s True Toll

A dismal, snowy plot near the Black Sea is the final resting place for more and more soldiers from the Wagner mercenary forces, a testament to the huge casualties Russia is suffering in its invasion. Read more

@nytimes

Western allies will support Ukraine in a spring offensive against Russia, U.S. defense chief says.

Ukraine’s Western allies must help its armed forces learn to use a wide variety of modern weapons systems, from artillery and tanks to armored vehicles and missiles, to accomplish a spring offensive against Russian forces that could swing the battlefield momentum toward Kyiv, the U.S. defense secretary, Lloyd J. Austin III, said on Tuesday. Read more

@nytimes

Ukraine steps up efforts to get civilians out of Bakhmut, in a further sign of a potential retreat.

Ukrainian authorities are stepping up efforts to persuade the few thousand remaining civilians to leave Bakhmut in the face of a sustained Russian assault, a regional official said on Tuesday, adding to signs that Kyiv may be preparing to retreat from a city it has defended fiercely for months. Read more

@nytimes

Guided Missile Killed U.S. Aid Worker in Ukraine, Video Shows

A deliberate missile strike, not indiscriminate shelling, likely killed the American paramedic Pete Reed in Ukraine, a New York Times analysis found. It is unclear whether the attackers, almost certainly Russian troops, knew he was with other aid workers. Read more

@nytimes

Ukraine Rushes to Repair After Wave of Russian Strikes

Ukrainian utility crews were working to repair new and significant damage to the country’s energy grid, officials said on Saturday, after Russia launched a swarm of Iranian-made attack drones overnight on the heels of a huge barrage of cruise missiles, antiaircraft missiles and drones on cities across Ukraine. Read more

@nytimes

Ukraine Rushes to Repair After Wave of Russian Strikes

Ukrainian utility crews were working to repair new and significant damage to the country’s energy grid, officials said on Saturday, after Russia launched a swarm of Iranian-made attack drones overnight on the heels of a huge barrage of cruise missiles, antiaircraft missiles and drones on cities across Ukraine. Read more

@nytimes

Oil prices rise after a Kremlin official says Russia will cut production to counter sanctions.

Russia announced on Friday that it would cut its oil production next month by 500,000 barrels a day, or about 5 percent of its output — Moscow’s first substantive response to a wave of recently imposed sanctions on the country’s oil trade. Read more

@nytimes

The prime minister of Moldova, a Ukrainian neighbor rattled by the war, steps down.

The pro-Western prime minister of Moldova, a troubled Eastern European nation that borders Ukraine, resigned on Friday, buffeted by a severe energy crisis, soaring inflation and errant missiles as a result of the war raging next door. Read more

@nytimes

Ukraine says Russia fired missiles and drones in waves to evade air defense systems.

Russia targeted Ukraine’s already battered infrastructure with drones, rockets and cruise missiles on Friday, raining fire on cities around the country one day after President Volodymyr Zelensky wrapped up a two-day push in Europe for more, faster support. Read more

@nytimes

Life on the Beat for Ukraine’s Cops: The Drunk, the Disorderly and Drones

In Ukrainian cities under Russian bombardment, struggling with blackouts and gripped by uncertainty, police patrols are trying to retain a sense of security for a traumatized public. “There is nothing really that can surprise us anymore,” one officer said. Read more

@nytimes

Wagner, the Russian mercenary group, says it has stopped recruiting prisoners.

The founder of the Kremlin-affiliated Wagner mercenary group, known for its ruthless tactics and harsh discipline, said on Thursday that it would no longer recruit fighters in Russian prisons. That would end a practice that has raised criticism from human rights groups but helped Moscow grind out advances in Ukraine’s east. Read more

@nytimes

Zelensky thanks Britain and redoubles his demand for jets.

President Volodymyr Zelensky, on a surprise visit to London on Wednesday, thanked Britain for its robust military support of his country but issued a blunt demand: supply Ukraine with fighter jets, a step the British government has so far resisted. Read more

@nytimes

Zelensky asks for national unity and no rumor-mongering amid his government’s shake-ups.

President Volodymyr Zelensky on Thursday warned Ukrainians to ignore “rumors or other pseudo-information” after a week of governmental shake-ups in Kyiv, a rare display of Ukraine’s leadership struggling to control the narrative of the war. Read more

@nytimes

Ukraine may no longer have a troop advantage, but Russia’s bolstered forces are still struggling.

Russia’s bolstered forces are struggling to make slow gains in eastern Ukraine, and though Ukraine’s defending forces appear due to wait for months or longer for promised Western tanks, they may still have an advantage. Read more

@nytimes

Moscow’s forces are advancing only a few hundred meters a week, U.K. intelligence says.

As Russia makes slow, bloody gains in a renewed push to capture more of eastern Ukraine, it is pouring ever more conscripts and military supplies into the battle, Ukrainian officials say, although it remains far from clear that Moscow could mobilize enough forces to sustain a prolonged offensive. Read more

@nytimes

Outnumbered and Worn Out, Ukrainians in East Brace for Russian Assault

The war in eastern Ukraine is intensifying in a string of villages, where doctors struggle to handle an influx of gruesome injuries and soldiers fret about a Russian army sending waves of new conscripts. Read more

@nytimes

The Ukrainian military reports attacks at dozens of points across the eastern front.

Russian forces attacked dozens of Ukrainian positions across the eastern front, the Ukrainian military said on Monday, as Moscow’s assaults widen and intensify ahead of what Kyiv has warned could be the Kremlin’s largest offensive since the first weeks of the war. Read more

@nytimes

A possible shake-up looms in Ukraine’s Defense Ministry.

As Ukrainian forces battle to hold off an intensifying Russian assault in the east, Defense Minister Oleksii Reznikov could soon be reassigned, which would make him the highest-ranking Ukrainian official to change jobs since Russia’s full-scale invasion. Read more

@nytimes

When It Comes to Building Its Own Defense, Europe Has Blinked

Russia’s invasion of Ukraine is the greatest challenge to European security since the Cold War. But diplomats and experts say Europe has missed the opportunity to step up its own defense, and the war has reinforced Europe’s military dependence on the U.S. Read more

@nytimes

Russia Pushes to Take Ukrainian Town Near a Vital Supply Line

Russia is deploying thousands of soldiers to southeastern Ukraine in an effort to secure a key supply line that runs from the eastern Donbas region to Crimea and is threatened by Ukrainian forces positioned in and around the strategically important town of Vuhledar. Read more

@nytimes

France and Italy pledge to send air defense systems to Kyiv.

France and Italy agreed to send antimissile systems to Ukraine to help it to better defend its civilians and infrastructure from Russian air attacks, the French Defense Ministry said on Friday. Read more

@nytimes

Zelensky insists that ‘no one will give away Bakhmut.’

President Volodymyr Zelensky vowed that his country’s forces would continue to hold the embattled city of Bakhmut, even as Russian forces close in on the city after months of pitched battles that have turned the area in eastern Ukraine into a wasteland. Read more

@nytimes

E.U. leaders visiting Kyiv are expected to encourage Ukraine but make no promises on joining the bloc.

European Union leaders visiting Kyiv on Friday are expected to offer symbolic support in its battle against Russia, without creating false hope over Ukraine’s bid to join the bloc. Read more

@nytimes

Putin uses a World War II anniversary to vow victory in Ukraine.

As his military pressed its eastern campaign with missile strikes on a key Ukrainian military hub, President Vladimir Putin used a speech in the city formerly known as Stalingrad on Thursday to invoke the Soviets’ defeat of the Nazis in a decisive World War II battle and vow that Russia would be victorious. Read more

@nytimes

Funds for Russia, frozen for 15 years, will be redirected to aid Ukraine, U.S. says.

More than $135 million of a long-dormant U.S. government fund that was established to invest in Russia’s private sector will be distributed to help the economies of Ukraine and its neighbor, Moldova, recover from Russia’s war, the U.S. Agency for International Development announced on Wednesday. Read more

@nytimes

As fighting intensifies in the east, Bakhmut is mostly deserted except for soldiers.

As Moscow intensifies its campaign to capture the entire Donbas region, fierce fighting is concentrated around the forlorn eastern city of Bakhmut, where Russian forces have been slowly closing in on vital supply lines. Ukraine’s president has described the escalation as a sign that Moscow is in the early stages of a new offensive. Read more

@nytimes

Russia’s bombardment grows, even as its next steps remain unclear.

As Western allies rush heavier weapons to help Ukraine reclaim occupied territory, Moscow’s forces are intensifying assaults along the eastern front in what President Volodymyr Zelensky of Ukraine has described as the opening moves of a new Russian offensive. Read more

@nytimes

Ukraine used land mines in the formerly occupied city of Izium, a new report claims.

The Ukrainian military has deployed thousands of antipersonnel mines in battle in apparent violation of an international treaty barring their use, according to a report by Human Rights Watch published on Tuesday. Read more

@nytimes

Russia owes its recent gains to increased troop numbers, Ukrainian forces say.

Firepower has been crucial in Russia’s gains in the war, but Ukrainian fighters and analysts say that Moscow has relied increasingly on a more crude tactic as its forces try to take the eastern city of Bakhmut: the sheer weight of troop numbers. Read more

@nytimes

Russia Freed Prisoners to Fight Its War. Here’s How Some Fared.

Tens of thousands of inmates have joined a mercenary group fighting with the Kremlin’s decimated forces in Ukraine. Some of them are returning to civilian life with military training and, in many cases, battlefield traumas. Read more

@nytimes

Russian forces ratchet up the pressure on a key eastern city.

Russian forces are ratcheting up pressure on the eastern Ukrainian city of Bakhmut, pouring in waves of fighters in an effort to break Ukraine’s resistance and targeting its supply lines in a bloody campaign aimed at securing Moscow’s first significant battlefield victory in months. Read more

@nytimes

‘We have to make time our weapon,’ Zelensky says.

President Volodymyr Zelensky has implored allies to speed up delivery of weapons as Russia intensifies its assaults on eastern Ukraine and sends waves of troops in an effort to break through heavy Ukrainian defenses. Read more

@nytimes

Russia and Ukraine Battle for Control of Villages Near the Key City of Bakhmut

Russian forces were wrestling for control of villages in eastern Ukraine near the beleaguered city of Bakhmut over the weekend, the latest flash point in a battle that Moscow views as crucial for its push to seize the whole of the eastern region of Donbas. Read more

@nytimes

Fighting Rages in Eastern Ukraine Over Critical Supply Routes

Russian troops mounted a fierce assault on Ukrainian forces on Saturday in an effort to dislodge them from critical positions in eastern Ukraine, with Moscow seeking to protect vital supply routes and both armies jockeying for position in anticipation of new offensive campaigns. Read more

@nytimes

Nuclear experts at the Zaporizhzhia power plant raise concerns about nearby explosions.

United Nations inspectors at the Zaporizhzhia Nuclear Power Plant in southern Ukraine say explosions from the artillery war being waged nearby rattle the facility almost daily, raising concerns that the danger to the plant has not improved despite the U.N.’s pleas for Kyiv and Moscow to create a cease-fire zone around it. Read more

@nytimes

Russian shelling kills eight civilians in Donetsk Province in eastern Ukraine.

Russian shelling has killed at least eight civilians in towns and villages along the front line in Donetsk Province in eastern Ukraine over the past 24 hours, local officials said on Friday, the latest violence in a region that has experienced the war’s heaviest recent fighting and that Ukraine fears could be a target of a fresh offensive by Moscow. Read more

@nytimes

Russia continues to stifle the free press and outlaws Meduza, a leading independent news site.

Russian officials labeled the independent news website Meduza an “undesirable organization” and effectively outlawed its content. The move made Meduza the latest outlet to fall victim to Russia’s efforts to stifle press freedom and suppress criticism. Read more

@nytimes

In Wave of Strikes, Russian Missiles Kill 12 Across Ukraine

Russia fired dozens of missiles at Ukrainian cities on Thursday, piercing snow clouds and air defenses to kill at least 12 people across the country, in the Kremlin’s campaign to punish civilians while its army fights in Ukraine’s east. Read more

@nytimes

Fresh from securing tanks, Ukraine turns to the next weapon on its wish list: Fighter jets.

No sooner had Ukraine secured its latest sought-after Western military equipment than it renewed its pleas for yet another advanced weapon: fighter jets. Read more

@nytimes

Biden announces 31 Abrams tanks for Ukraine, but says the move is not meant to escalate the war.

President Biden announced on Wednesday that he would send M1 Abrams tanks to Ukraine to help it defend against Russian invaders, a decision meant to unlock a wave of heavier aid by Western allies in preparation for an expected escalation of fighting in the spring. Read more

@nytimes

Germany says it will send an initial shipment of 14 tanks to Ukraine.

Chancellor Olaf Scholz announced on Wednesday that Germany would send an initial shipment of 14 Leopard 2 tanks to Ukraine and allow other nations to send their own, relenting after weeks of domestic and international pressure to deliver armored vehicles aimed at helping Kyiv regain territory seized by Russia. Read more

@nytimes

Ukraine says that its forces have retreated from Soledar after an intense battle.

Ukrainian forces have retreated from the small town of Soledar following weeks of bitter fighting, a military spokesman said on Wednesday, acknowledging a military gain for Russian forces that brings them closer to encircling and possibly capturing the strategic eastern city of Bakhmut. Read more

@nytimes

The U.S. is moving closer to sending M1 Abrams tanks to Ukraine, officials say.

The Biden administration is moving closer to sending M1 Abrams tanks to Ukraine, U.S. officials said on Tuesday, in what would be a major step in arming Kyiv in its efforts to seize back its territory from Russia. Read more

@nytimes

Zelensky tries to show zero tolerance for corruption as allies send more aid.

President Volodymyr Zelensky’s government dismissed two more officials on Tuesday, the latest changes in Ukraine’s leadership that are part of a renewed push to root out corruption. Read more

@nytimes

Safe at Home in Dnipro, Until a Russian Missile Struck

Life in Ukraine still proceeds almost normally at times. Then, suddenly, it all changes. That happened one Saturday this month, when a Russian missile struck an apartment complex, in one of the deadliest attacks against civilians since early in the war. Read more

@nytimes

Poland steps in as pressure grows on Germany to supply Leopard tanks.

Pressure has been growing on Germany to authorize the transfer of its Leopard 2 battle tanks to Ukraine, which are stocked by many European countries and which Kyiv sees as crucial to its war effort as fighting is expected to intensify again this spring. Polish officials have been among the loudest voices urging Germany to sign off, which it is legally required to do as the tank’s maker. Read more

@nytimes

U.S. Extends Troop Deployment in Romania, at Ukraine War’s Doorstep

The Pentagon will keep several thousand American troops in southeast Romania for at least nine more months, closer to the war in neighboring Ukraine than any other U.S. Army unit, officials said on Saturday. Read more

@nytimes

Amid Mounting Frustration With Germany, Ukraine Holds Out Hope It Will Get Tanks

As frustration at Germany for seemingly dragging its feet on sending Ukraine advanced Leopard 2 tanks mounted on Saturday, Ukrainian officials indicated that they believed it would be only a matter of time before the sophisticated weapons arrived. Read more

@nytimes

Video of Serbian mercenaries training with Russian troops stirs anger in Belgrade.

Video footage released by Russian state media that purports to show Serbian mercenaries training for battle alongside Moscow’s troops in Ukraine has outraged authorities in Serbia, which has spent years trying to join the European Union and shed its reputation as a Kremlin supporter. Read more

@nytimes

The U.S. will impose new sanctions on the Wagner mercenary group in Russia.

The United States has decided to designate the Russian private military group Wagner as a significant transnational criminal organization, the White House said on Friday, a move that will expand the number of nations and institutions that can be prevented from doing business with the company. Read more

@nytimes

A meeting of Ukraine allies ends with no consensus on sending German tanks.

Western defense officials meeting in Germany on Friday failed to produce an agreement for exporting battle tanks to Ukraine, in a setback to Ukraine’s hopes of quickly getting a weapon it sees as crucial to its defense against an expected new Russian offensive. Read more

@nytimes

‘History is watching us’: Western defense officials meet, with the question of Leopard 2 tanks at the forefront.

The U.S. defense secretary, Lloyd J. Austin III, opened a meeting of Western defense officials on Friday to coordinate additional military assistance for Ukraine, even as the critical question of whether European tank deliveries to Kyiv would be authorized remained unanswered. Read more

@nytimes

At Davos, calls for unity on Ukraine come easier, thanks to European resilience on energy.

Chancellor Olaf Scholz of Germany offered a robust expression of solidarity with Ukraine at the World Economic Forum this week, a stance reflecting not only the imperative of repelling a brutal aggressor but also palpable relief that Europe has not been crippled by Russia’s war. Read more

@nytimes

The new U.S. aid aims to help Ukraine ‘break through’ Russian defenses.

The United States plans to send Ukraine nearly 100 Stryker combat vehicles as part of a roughly $2.5 billion shipment of arms and equipment that is expected to be announced at a meeting of allies in Germany on Friday, two U.S. officials said on Thursday. Read more

@nytimes

‘Tragedies are outpacing life’: In a video address at Davos, Zelensky mourns the dead and pleads for help.

President Volodymyr Zelensky made a passionate appeal by video on Wednesday to heads of state and other decision makers gathered at the World Economic Forum in Davos, Switzerland, urging a faster pace of support for his country in the face of Russia’s invasion. Read more

@nytimes

Russians shells villages close to the town of Soledar, the scene of intense battles in recent weeks.

Russian forces were shelling villages close to the town of Soledar in Ukraine’s east, the Ukrainian authorities said on Wednesday, as Moscow pressed ahead with its campaign to encircle and capture the nearby city of Bakhmut, the site of some of the fiercest recent battles in the war. Read more

@nytimes

The top generals from the U.S. and Ukraine meet in Poland, face to face for the first time.

Days before Western allies meet to discuss sending more advanced weaponry, including tanks, to Ukraine, the top U.S. general met with his Ukrainian counterpart in person for the first time on Tuesday in southeastern Poland. Read more

@nytimes

Ukraine’s first lady urges leaders at Davos to use their influence to help her country.

Ukraine’s first lady, Olena Zelenska, on Tuesday challenged leaders gathered at the World Economic Forum in Davos, Switzerland, to use their influence to help her country, part of a concerted push by Kyiv for more powerful weapons that comes as the war is approaching its 12th month. Read more

@nytimes

Pressure grows on Germany to authorize tanks for Ukraine.

As Ukraine redoubles its pleas for more advanced weapons during what could be a pivotal week of diplomacy, pressure is mounting on Germany to authorize the export to Ukraine of its main battle tank to help Kyiv’s forces take the initiative on the battlefield in eastern Ukraine and better defend against Russian aerial attacks. Read more

@nytimes

A Wagner fighter defects to Norway, promising to expose Russian war crimes in Ukraine.

A former member of a notorious Russian paramilitary force has surrendered to Norwegian authorities, a rare defection that his lawyer and Russian human rights activists say could aid international investigations into Moscow’s atrocities in Ukraine. Read more

@nytimes

Zelensky pushes allies to move faster with aid as fears grow of a new Russian offensive.

President Volodymyr Zelensky praised the British announcement of a new military aid package and urged other allies to move faster to match that support as Ukraine warns that Russia could be preparing a renewed push to capture more territory. Read more

@nytimes

Ukraine has gradually persuaded allies to send more advanced weapons.

Britain is sending a squadron of 14 Challenger 2 tanks to Ukraine and plans to lobby the U.S., Canada and Europe to follow suit. Only months ago sending such weapons to Ukraine was considered taboo. Read more

@nytimes

Dead, Alive or Devastated After Russian Strike on Apartments

As smoke and dust rose into the Dnipro sky, a light dusting of snow began to accumulate on five victims who had been pulled from the rubble and laid out in body bags in a small grassy area next to the destroyed building. They were five of 30 confirmed killed in a Russian strike on a civilian neighborhood — 79 were injured — and at least 30 people remained unaccounted for. Read more

@nytimes

Britain Says It Will Give Ukraine Tanks, Breaching a Western Taboo

After years of resisting providing Ukraine with some of the West’s most high-powered weaponry, Britain indicated on Saturday that it would give battle tanks to Ukrainian forces to help prepare them for anticipated Russian assaults this spring. Read more

@nytimes

Rescuers rush to save people in the rubble of a Dnipro apartment building destroyed in a Russian strike.

A Russian strike tore into a nine-story apartment building in the city of Dnipro in central Ukraine, local officials said, killing at least five people and injuring dozens. Read more

@nytimes

Explosions Ring Out in Kyiv After Days of Relative Calm

A series of explosions rang out in Kyiv, the Ukrainian capital, on Saturday morning after Russian strikes, jolting residents from a relative quiet that had taken hold over the last two weeks during a festive holiday period in the country. Read more

@nytimes

The internet is a lifeline in Ukraine. Keeping it running is a key government focus, a minister says.

As repair crews race to restore power supplies after crippling Russian attacks on energy infrastructure, the Ukrainian government has also been working around the clock to come up with creative ways to keep people connected to the vital lifeline of the internet. Read more

@nytimes

Western Tanks Appear Headed to Ukraine, Breaking Another Taboo

Fearing a new Russian attack, the West is taking more risks to defend Ukraine amid a stalemate in the war. It looks likely that modern tanks will be added to the growing list of powerful weapons being sent Ukraine’s way. Read more

@nytimes

Zelensky says that Ukrainian troops still hold on in Soledar.

President Volodymyr Zelensky of Ukraine said on Thursday that Ukrainian troops continue to hold on in Soledar, despite claims by Russian mercenaries that they had taken control of the town. Read more

@nytimes

Russia released a U.S. Navy veteran who had been quietly detained.

Russia released a Navy veteran who had been detained since April in Kaliningrad, a Russian enclave between Poland and Lithuania, a spokesman for his family announced on Thursday, marking the second time in just over a month that an American has been freed from Russian custody. Read more

@nytimes

As Poland and Britain weigh sending tanks to Kyiv, pressure on other allies mounts.

Poland and Britain are considering sending main battle tanks to Ukraine, a move that would end the West’s nearly yearlong refusal to deploy some of its most advanced weaponry against Russia and ratchet up pressure on other allies of Kyiv to follow suit. Read more

@nytimes

Satellite images show the scale of destruction in Soledar and a nearby village.

The hotly contested town of Soledar in eastern Ukraine and the nearby village of Bakhmutske have been decimated by intense artillery battles in recent weeks, newly released satellite images show. Read more

@nytimes

Poland says it’s willing to provide Ukraine with German-made tanks, adding pressure on Berlin to agree.

The president of Poland said on Wednesday that his country was prepared to send German-made Leopard II tanks to Ukraine if an “international coalition” agreed to do so, further ratcheting up the pressure on Berlin to approve the transfer of top-level combat tanks that Kyiv has been requesting to support potential offensives against Russian forces in the coming months. Read more

@nytimes

Russia posts a $47 billion budget deficit for 2022, its second highest in the post-Soviet era.

Strained by the need to finance its war machine, the Russian government said on Tuesday that it had posted a $47 billion budget deficit in 2022, which is the second-highest since the break up of the Soviet Union. Read more

@nytimes

Russian Mercenary Group Says It Has Taken Contested Ukrainian Town

The head of a Russian mercenary group fighting in Ukraine claimed on Tuesday that his fighters had seized the town of Soledar, the site of brutal combat recently, which if true would mark the first significant Russian victory after months of setbacks. Read more

@nytimes

Zelensky says Ukraine’s tough fighting in the east has allowed time for critical reinforcements.

President Volodymyr Zelensky of Ukraine says he plans to send more troops and some of the newest weapons provided by allies to the eastern region of Donbas, where some of the toughest fighting of the nearly yearlong war is taking place in and near Bakhmut. Read more

@nytimes

The fight over Soledar underscores the divisions between Russia’s Army and a Russian mercenary force.

Even as Russia engages in a grinding battle for territory in eastern Ukraine, there are signs of continued disarray and infighting between its official military and the mercenary group that employs some of its most experienced fighters. Read more

@nytimes

Heavy fighting and competing claims surround the key eastern city of Bakhmut.

Fierce fighting was raging on Monday around the heavily contested city of Bakhmut, Ukrainian and Russian officials said, with claims and counter claims swirling about potential Russian advances on the key battlefront in eastern Ukraine. Read more

@nytimes

Ukraine moves ‘step by step’ as the pace slows in carrying out offensives in the east.

“We are moving forward little by little, step by step,” Ukraine’s deputy defense minister, Hanna Maliar, said on Sunday in a post on Telegram. While she was referring to fighting in the eastern Donbas region, her assessment could be applied to the conflict as a whole. Read more

@nytimes

Now Fighting for Ukraine: Volunteers Seeking Revenge Against Russia

Ukraine’s military commanders have long said they do not lack soldiers for the war, but they have nonetheless welcomed to their ranks thousands of volunteers, including foreign citizens. Many of them, like the Chechens, are refugees from Russia itself. Others have come from surrounding nations, like Georgia, that have a history of opposition to Moscow and the leadership of President Vladimir V. Putin. Read more

@nytimes

Ukrainians Celebrate Orthodox Christmas at a Holy Site Long Linked to Moscow

Confronting the divide among the Orthodox faithful in Ukraine, the head of the church that is loyal to Kyiv delivered a Christmas sermon for the first time at the country’s most historically significant monastery on Saturday. The Mass highlighted the deep fracture with the separate Moscow-led church that has traditionally celebrated at the holy site. Read more

@nytimes

New Armored Vehicles Will Help Ukraine Take the Fight to Russia

News Analysis: The three new types of armored vehicles that Washington, Paris and Berlin offered to Kiev this week seem to mark a policy shift among the Western allies, giving more lethal support to the Ukrainian infantry, indicating less anxiety about Russian escalation and angling for more decisive Ukrainian victories in 2023. Read more

@nytimes

Battered and Strained by War, Ukraine’s Economy Adapts to Survive

Despite major battlefield defeats in its invasion, the Kremlin’s relentless war effort has sown economic havoc atop a devastating humanitarian toll in Ukraine. The country’s economy shrank by 30.4 percent in 2022, its economy minister said Thursday, the largest decline since Ukraine declared independence from the Soviet Union in 1991. Read more

@nytimes

Russia’s frontline attacks showed no signs of abating in the run-up to Putin’s cease-fire.

A unilateral Russian cease-fire announced for Friday appeared to have little effect in its early hours, as fighting continued and Moscow claimed it was defending itself against Ukrainian strikes. Read more

